'use strict'

import react, {Component, View, TouchableHighligth, Alert, StyleSheet, NativeModules} from 'react-native'

class Like extends Component {
    render() {
        return (
            <View>
                <TouchableHighligth onPress={(this.clickLike.bind(this))} style={style.button}>
                    <Text style={styles.textButton}> Me gusta </Text>
                </TouchableHighligth>
            </View>
        )
    }
    clickLike() {
        Alert.alert (
            'Me gusta',
            'No me gusta' 
            [{
                text: 'like',
                onPress: (this.like.bind(this))
                },
                {
                text: 'unlike',
                onPress: (this.unlike.bind(this))
                }
            ]	
        )
        }

        like(){
            console.log('Me gusta')
        }
        unlike(){
            console.log('Ya no me gusta')
        }
    }

const styles = StyleSheet.create ({
    button: {
        width: 100,
        height: 30,
        backgroundColor: '#c1a1d3',
        alignItems: 'center',
        justifyContent: 'space-between',
        marginTop: 10,
        marginBottom: 10,
        borderRadius:8,
        borderWidth:1
    },
    textButton:{
        color: 'withe'
    }
})

module.exports = Like;
